import React, { useState, useEffect } from "react";
import Content from "../../components/Content";
import axios from "axios";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";
import PersonAddIcon from "@mui/icons-material/PersonAdd";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Layout from "../../containers/Layout";
import { useParams } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import AgendaServices from "../../services/AgendaServices";

const PacientesAgendaEditar = (id) => {
  const [agenda, setAgenda] = useState([]);
  const [idPaciente, setidPaciente] = useState("");
  const [nomPaciente, setnomPaciente] = useState("");
  const [ap1Paciente, setap1Paciente] = useState("");
  const [ap2Paciente, setap2Paciente] = useState("");
  const [comentario, setComentario] = useState("");
  const [fecha, setFecha] = useState("");
  const [hora, setHora] = useState("");

  const routeParams = useParams();
  const navigate = useNavigate();
  const server = 'http://localhost:4002';

  const getData = async () => {
    console.log(routeParams.id);
    const dataAg = await axios.get(`${server}/agenda/${routeParams.id}`);
    console.log(dataAg);
    setidPaciente(dataAg.idPaciente);
    setComentario(dataAg.comentario);
    setFecha(dataAg.fecha);
    setHora(dataAg.hora);
   

    const { data } = await axios.get(`${server}/pacientes/${dataAg.idPaciente}`);
    setnomPaciente(data.nomPaciente);
    setap1Paciente(data.ap1Paciente);
    setap2Paciente(data.ap2Paciente);
    console.log(data);

    const  data2  = await AgendaServices.getAgendaIdP(data.idPaciente);

    console.log(data2);
    setAgenda(data2);
    
  };

  useEffect(() => {
    getData();
  }, []);

  const handleComentario = (event) => {
    setComentario(event.target.value);
  };
  const handleFecha = (event) => {
    setFecha(event.target.value);
  };
  const handleHora = (event) => {
    setHora(event.target.value);
  };
  
  const Cancelar = () => {
    navigate("/agenda");
  };

  const handleSubmit = () => {
    let agenda = {
      comentario: comentario,
      fecha: fecha,
      hora: hora,
      idPaciente: parseInt(idPaciente),
    };
    console.log(agenda);
    AgendaServices.updateAgenda(agenda,routeParams.id);
    navigate(`/pacientes-agenda/${idPaciente}`);
  };

  return (
    <Content>
      <h1>Programar agenda</h1>
      <h2> {nomPaciente + " " + ap1Paciente + " " + ap2Paciente} </h2>
      <center>
        <table class="wrapper">
          <tr>
            <td>
              
            </td>
          </tr>
          <tr>
            <td>
              
            </td>
          </tr>
          <tr>
            <td>
              <label class="textoCaja">
                Comentario:
                <input type="text" value={comentario} class="redondeado" name="comentario" onChange={handleComentario} />
              </label>
            </td>
          </tr>
          <tr>
            <td>
              
            </td>
          </tr>
          <tr>
            <td>
              <label class="textoCaja">
                Fecha:
                <input type="text" value={fecha} class="redondeado" name="fecha" onChange={handleFecha} />
              </label>
            </td>
          </tr>
          <tr>
            <td>
              
            </td>
          </tr>
          <tr>
            <td>
              <label class="textoCaja">
                Hora:
                <input type="text" value={hora} class="redondeado" name="hora" onChange={handleHora} />
              </label>
            </td>
          </tr>
          <tr>
            <td>
              
            </td>
          </tr>
          <tr>
            <td>
              <button class="estiloBoton" onClick={handleSubmit}> Editar </button>
            </td>
            <td>
              <button class="estiloBoton" onClick={Cancelar}> Cancelar </button>
            </td>
          </tr>
        </table>
      </center>
    </Content>
  );
};

export default PacientesAgendaEditar;
